column17:
Realizei acompanhamento no intuito de agilizar o plantio de palma.
Orientar sobre o espaçamento;
sobre a adubação e como organizar aposição das covas

Na visita realizamos novo plantio de milho, entalação da mangueira de gotejamento.
Orientei a adubação orgânica com esterco;
e melhorar a questão do aramzenamento

Foi realizado acompanhamento na propriedade, e na oportunidade foi realizado atividade para realizar plantio de palma.
Foi orientado sobre adubação;
Sobre curva de nível e escolha das raquetes;

Agricultor vem tentando melhora o manejo sanitário dos animais;
Para isso foi orientado a questão do melhoramento da estrutura do galinheiro;
fazer uma reforma no iso para poder facilitar a limpeza e retirada das fezes das aves

Na ultima visita foi realizado divisão de colmeia;
Revisão do apiário;
e coleta de mel.
Foi uma tarde muito proveitosa onde realizamos diversas atividades no apiário de dois apicultores, conseguimos colher em trono de 1200 k de mel e que vai servi para alimentação da família e para vender.

Melhorou a produção;
Está investindo mais em conhecimento técnico;
Comprou forrageira;
Fez estoque de ração.

Aumento do conhecimento com as técnicas de produção, 
Melhor produtividade com o uso do esterco orgânico;
Contribui para o sistema de produção e para a segurança alimentar, pro produzir alimentação saudável.

Avançamos na produção de forragem e no manejo alimentar.
No estoque de alimento;
No conhecimento técnico e na produção.

Plantio e cultivo de capim de corte e mandioca;
Precisa diversificar amais produção;
Aproveitar esterco para adubar as terras de plantio.
Avanço no armazenamento de comida para os animais

A agricultora anda adoentada e fazendo pouca atividade rural.
Aguarda a liberação do recurso do fomento;
Pouca ação desenvolvida na propriedade.

Precisa melhorar o manejo alimentar sanitário;
Buscar produzir mais alimento;
Melhorar o espaço de produção;
Melhorar a higiene.
